(12, 3, 12, '<p>&ldquo;<em>I&rsquo;m very happy to see so many of you here today</em>&rdquo;</p>\r\n<p>The sentence above refers to ...</p>', 1, '<p>Welcoming your audience</p>', '<p>Opening</p>', '<p>Introducing your subject</p>', '<p>Inviting questions</p>', '<p>Thanking your audience</p>', 'B', '', '', '', '', '', '', ''),
