(14, 3, 14, '<p>&ldquo;<em>Any questions</em>?&rdquo;</p>\r\n<p>The sentence above refers to ...</p>', 1, '<p>Welcoming your audience</p>', '<p>Introducing your subject</p>', '<p>Introducing your subject</p>', '<p>Inviting questions</p>', '<p>Thanking your audience</p>', 'D', '', '', '', '', '', '', ''),
