(16, 3, 16, '<p>I would like to ..... you of the current news</p>', 1, '<p>Speak</p>', '<p>Inform</p>', '<p>Describe</p>', '<p>Decline</p>', '<p>Say</p>', 'B', '', '', '', '', '', '', ''),
(17, 3, 17, '<p>Could you ...... up? We can&rsquo;t hear you at the back</p>', 1, '<p>Talk</p>', '<p>Say</p>', '<p>Speak</p>', '<p>Tell</p>', '<p>Describe</p>', 'C', '', '', '', '', '', '', ''),
(18, 3, 18, '<p>I need to ...... the place as I don&rsquo;t have any photos with me</p>', 1, '<p>Explain</p>', '<p>Describe</p>', '<p>Present</p>', '<p>Say</p>', '<p>Talk</p>', 'B', '', '', '', '', '', '', ''),
(19, 3, 19, '<p>Let me ...... why we have to cut costs</p>', 1, '<p>Explain</p>', '<p>Decsribe</p>', '<p>Present</p>', '<p>Tell</p>', '<p>Say</p>', 'A', '', '', '', '', '', '', ''),
(20, 3, 20, '<p>I couldn&rsquo;t ...... how long will it take</p>', 1, '<p>Talk</p>', '<p>Speak</p>', '<p>Say</p>', '<p>Tell</p>', '<p>Cheat</p>', 'B', '', '', '', '', '', '', ''),
(21, 3, 21, '<p>Pay attention to the conversation below!</p>\r\n<p>Anna&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Do you want me to set up the meeting room?&rsquo;</p>\r\n<p>Bam &nbsp;&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Yes, if you dont mind.&rdquo;</p>\r\n<p>Anna&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Not at all. I&rsquo;ll be happy to set it up.&rdquo;</p>\r\n<p>Bam&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Thanks. I really appreciate it.&rdquo;</p>', 1, '<p>No, he doesn&rsquo;t</p>', '<p>No, she doesn&rsquo;t</p>', '<p>Yes, he did</p>', '<p>Yes, she didn&rsquo;t</p>', '<p>No, she didn&rsquo;t</p>', 'E', '', '', '', '', '', '', ''),
(22, 3, 22, '<p>Pay attention to the conversation below!</p>\r\n<p>Seller&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Good morning. Do you need help?</p>\r\n<p>Buyer&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Yes, I need a break to breakfast. Can you give me a recommend?&rdquo;</p>\r\n<p>Seller&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Yes, cheese bread with a blueberry sauce is popular here. Do you want to try?&rdquo;</p>\r\n<p>Buyer&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Okay, I will buy it.&rdquo;</p>\r\n<p>Seller&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Do you need a paper bag?&rdquo;</p>\r\n<p>Buyer&nbsp; :&nbsp;&nbsp;&nbsp; &ldquo;Thank you.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>What does the buyer buy for his breakfast?</p>', 1, '<p>Bread with a strawberry sauce</p>', '<p>Bread with a blueberry sauce</p>', '<p>Bread with a peanut sauce</p>', '<p>Bread with a cheese sauce</p>', '<p>Bread with a chocolate sauce</p>', 'B', '', '', '', '', '', '', '');
