(61, 1, 1, ' Cermati pengumuman berikut dengan teliti!PT PELITA JAYAJalan MT Haryono 10 JakartaNo. 120/PK/08/202128 Oktober 2021PENGUMUMANDibutuhkan tenaga administrasi minimal lulus SMK untuk ditempatkan di kantor cabang Depok&nbsp;&nbsp;dengan persyaratan&hellip;Kalimat pembuka surat lamaran kerja sesuai dengan pengumuman tersebut yang tepat adalah&hellip;', 1, 'Sehubungan dengan pengumuman Saudara pada tanggal 28 Oktober 2021&hellip;', 'Bersamaan ini saya mengajukan lamaran kerja berdasarkan pengumuman&hellip;', 'Mengingat surat Saudara nomor 120/PK/08/2021 pada 28 Oktober 2021&hellip;', 'Berdasarkan pengumuman nomor 120/PK/08/2021 pada 28 Oktober 2021&hellip;', 'Saya memberanikan diri mengajukan permohonan kerja kepada Bapak&hellip;', 'D', NULL, '', '', '', '', '', ''),
(62, 1, 2, ' Bacalah ilustrasi berikut!Seorang calon pelamar pekerjaan mengajukan sebuah surat lamaran pekerjaan yang ditujukan ke suatu PT yang bergerak di bidang telekomunikasi. Karena lowongan tersebut sudah terisi maka lamaran tersebut terpaksa ditolak.Kalimat penolakan lamaran pekerjaan yang sesuai dengan ilustrasi di atas adalah&hellip;', 1, 'Bersama ini, kami beritahukan bahwa lamaran Saudara tidak dapat diterima.', 'Sesuai dengan surat Saudara, dengan ini diberitahukan bahwa lamaran Saudara ditolak.', 'Lowongan pekerjaan yang Saudara kehendaki tidak ada dan kebetulan belum dibutuhkan.', 'Berhubungan dengan surat Saudara maka lamaran pekerjaan Saudara kami tolak sementara.', 'Dengan surat ini, kami memberitahukan bahwa lowongan kerja yang Saudara inginkan sudah terisi.', 'E', NULL, '', '', '', '', '', ''),
(63, 1, 3, ' Cermatilah kutipan penutup surat lamaran pekerjaan berikut!Atas perhatiannya, diucapkan terima kasih.Kalimat yang tepat untuk memperbaiki kalimat penutup surat tersebut adalah &hellip;.', 1, 'Atas perhatian Bapak, saya ucapkan terima kasih banyak.', 'Atas perhatian, saya tak lupa mengucapkan terima kasih.', 'Atas perhatian Bapak, saya mengucapkan terima kasih.', 'Atas perhatiannya, saya mengucapkan terima kasih.', 'Atas perhatian, diucapkan terima kasih kepada Ibu.', 'C', NULL, '', '', '', '', '', ''),
(64, 1, 4, ' Perhatikan ilustrasi berikut!Sebuah surat akan dikirim ke alamat :PT Astra Motor, jalan Kramat Raya nomor 132, Jakarta 10545Cara penulisan alamat surat yang benar&nbsp;adalah ....', 1, 'Yth. Pimpinan PT Astra MotorJln. Kramat Raya 132Jakarta 10453', 'Yth PimpinanPT. Astra MotorJalan Kramat Raya 132Jakarta 10453', 'Yth. PimpinanPT Astra MotorJalan Kramat Raya 132Jakarta 10545', 'Kepada Yth. PT Astra MotorJln. Kramat Raya 132Jakarta 10545', 'Kepada Yth.Pimpinan PT Astra MotorJalan Kramat Raya 132Jakarta 10545', 'C', NULL, '', '', '', '', '', ''),
