(68, 1, 8, ' Cermatilah kalimat surat balasan lamaran berikut!Anda ditunggu kehadirannya untuk tes tulis dan wawancara pada hari Senin,&nbsp;15&nbsp;Juli 2019 jam&nbsp;08.00&nbsp;WIB.Perbaikan surat balasan lamaran pekerjaan tersebut yang santun adalah...', 1, 'Selamat! Anda ditunggu ya pada hari Senin,&nbsp;15&nbsp;Juli 2019&nbsp;&nbsp;jam 08.00 untuk melakukan tes tulis dan wawancara.', 'Kami dari pihak perusahaan mengucapkan Selamat! Anda lulus tes administrasi. Ditunggu kehadirannya pada hari Senin,&nbsp;15&nbsp;Juli 2019&nbsp;&nbsp;jam 08.00 WIB untuk melakukan tes tulis dan wawancara.Semoga Anda bisa lulus.', 'Berdasarkan surat lamaran yang Saudara kirim, Saudara dinyatakan lulus seleksi administrasi. Selanjutnya, ditunggu kehadirannya pada hari Senin,&nbsp;15&nbsp;Juli 2019&nbsp;pukul 08.00 WIB untuk melakukan tes tulis dan wawancara.', 'Berdasarkan surat lamaran yang Anda kirim, Anda ditunggu pada hari Senin,&nbsp;15&nbsp;Juli 2019&nbsp;&nbsp;jam 08.00 untuk melakukan tes tulis dan wawancara.', 'Anda ditunggu pada hari Senin,&nbsp;15&nbsp;Juli 2019&nbsp;jam 08.00 untuk melakukan tes tulis dan wawancara.', 'C', NULL, '', '', '', '', '', ''),
