(78, 1, 18, ' Bacalah teks di bawah ini&hellip;!Pak Dirman memerintahkan agar istrinya menjual perhiasan untuk modal perjuangan. Pak Dirman dalam keadaan sakit parah digerogoti TBC dan paru-paru tinggal satu memimpin perang gerilya dari atas tandu. Bersama para gerilyawan yang beliau pimpin, berjuang keluar masuk hutan naik turun gunung demi memerdekakan kita anak cucu mereka. Berjuang dengan persenjataan seadanya, melawan musuh yang memiliki persenjataan modern didukung kekuatan laut dan udara. Gerilya berdasar pada taktik hit and run, ini ampuh untuk merontokkan moral Belanda. Latar waktu yang tampak pada penggalan teks cerita sejarah tersebut adalah &hellip;', 1, ' zaman kemerdekaan', ' masa penjajahan', ' era gerilya', ' di Yogayakarta', ' pagi hari', 'C', NULL, '', '', '', '', '', ''),
(79, 1, 19, ' Bacalah teks editorial berikut!Meski lulus dengan persentase tinggi, dari kawasan Indonesia timur masih timbul kerisauan tentang bagaimana bersaing dengan lulusan asal Jawa. Ini kerisauan yang harus kita pikirkan upaya mengatasinya. Sejumlah putra Indonesia timur, seperti dari Papua atau NTT, berhasil menunjukkan intelegensia tinggi, seperti unggul dalam olimpiade fisika. Tugas kita berikutnya, bagaimana kita menjadikan itu sebagai pola, bukan kasus.Kesimpulan yang tepat untuk teks editorial tersebut adalah...', 1, ' Upaya menyamakan persaingan lulusan Indonesia timur dengan Jawa.', ' Lulusan Indonesia timur sangat berprestasi.', ' Banyak ajang yang berhasil dijuarai putra putri Jawa.', 'Upaya pemerintah menjadikan lulusan asal Jawa lebih maju daripada Indonesia timur.', ' Menjadikan pola, bukan kasus.', 'A', NULL, '', '', '', '', '', ''),
(80, 1, 20, ' Bacalah teks editorial berikut!Sudah semestinya pemimpin Amerika tersebut mengambil langkah tegas seperti itu. Kalau tidak, bukan saja kepentingan rakyat Amerika yang akan dirugikan tetapi lebih besar lagi kepentingan ekonomi Amerika dalam kaitannya dengan kepercayaan asing yang akan dirugikan. Dengan langkah baru seperti yang diumumkan oleh Presiden Bush, kelak tindak&nbsp; korupsi akan disiarkan kepada publik dan dihukum. Akuntansi perusahaan juga akan ditarik keluar sistem yang kurang terbuka (out of the shadows). Dengan langkah itu pula, kepentingan investor kecil dan pemegang pensiun akan dilindungi.Pandangan redaksi pada teks editorial di atas terdapat dalam kalimat ...', 1, 'Kepentingan ekonomi AS dirugikan cukup besar gara-gara skandal akuntansi yang dilakukan presiden.', 'Perusahaan akuntansi akan ditarik dari sistem yang kurang terbuka (out of the shadows).', 'Sudah semestinyalah pemimpin AS mengambil tindakan tegas terhadap perusahaan yang korupsi.', 'Dengan keterbukaan, kepentingan investor kecil dan pemegang pensiun akan dilindungi.', 'Kelak tindak korupsi akan disiarkan kepada publik dan dihukum.', 'C', NULL, '', '', '', '', '', ''),
(81, 1, 21, ' Perombakan kabinet seharusnya bermuara pada strategi presiden dalam membentuk kabinetnya. Kabinet yang dibentuk idealnya dapat merefleksikan strategi politik dan kebijakan presiden. Perombakan sah-sah saja asal karena kebutuhan bukan hanya karena desakan publik atau politik terutama dalam mengakomodasi kepentingan partai tertentu. Presiden sebelumnya saja perlu merombak kabinetnya hingga lima kali.Isu yang diungkapkan dalam penggalan teks editorial tersebut adalah ...', 1, ' penambahan kabinet', ' strategi kabinet', ' perombakan kabinet', 'kabinet untuk kepentingan partai', 'kebijakan kabinet presiden', 'C', NULL, '', '', '', '', '', ''),
(82, 1, 22, ' Badan Pusat Statistik memasukkan pangan sebagai penentu garis kemiskinan. Oleh karena itu, pemerintah berkepentingan menjaga harga pangan selalu stabil. Program presiden dalam masa jabatan keduanya adalah memastikan ada cadangan beras sepuluh juta ton yang harus diusahakan dalam produksi dalam negeri. Keuntungan memproduksi sendiri pangan di dalam negeri adalah menghindarkan ketergantungan dari impor sehingga Indonesia memiliki ketahanan dan kedaulatan pangan. Memproduksi pangan di dalam negeri memberikan lapangan kerja di desa dan kota melalui kegiatan di ladang hingga industri pengolahan.Pihak yang dituju redaksi dalam teks editorial di atas adalah...', 1, ' perusahaan', ' pengimpor', ' pedagang', ' masyarakat', ' pemerintah', 'E', NULL, '', '', '', '', '', ''),
(83, 1, 23, ' Bacalah kutipan teks editoral berikut dengan saksama.(1) Tak dapat dipungkiri bahwa dalam berbahasa (Indonesia), ukuran baik dan benar masih sering menjadi permasalahan.(2) Sekalipun mudah didefinisikan, ukuran baik dan benar itu acap kali bias dalam implementasinya. (3)Mungkin karena secara terminologis kata baik dan benar itu sudah menyaran pada hal yang sempurna, tanpa cacat sehingga orang pun tidak segansegan memaknai slogan penggunaan bahasa Indonesia yang baik dan benar itu sama dengan bahasa Indonesia baku. (4)Sebagai akibatnya, tidak jarang orang (Indonesia) merasa tidak memiliki kemampuan untuk berbahasa Indonesia dengan baik dan benar.(5) Bahkan, banyak pula orang yang kemudian berantipati pada slogan itu karena merasa telah dibelenggunya.Kalimat fakta dalam teks editorial di atas terdapat dalam kalimat ke...', 1, ' (1) dan (3)', ' (2) dan (3)', ' (2) dan (4)', ' (3) dan (5)', ' (4) dan (5)', 'E', NULL, '', '', '', '', '', ''),
