(714, 21, 9, ' Perhatikan urutan langkah berikut.1) Perhatikan urutan langkah/ kegiatan secara runtun.2) Tentukan tema/ jenis teks yang hendak dibuat.3) Periksa kembali apakah ada langkah yang harus direvisi.4) Tentukan jumlah langkah yang dibutuhkan untuk menyelesaikan kerja tersebut.Urutan yang tepat tahapan dalam membuat teks prosedur adalah...', 1, '  1), 2), 3), 4)', '  1), 2), 4), 3)', '  2), 4), 1), 3)', '  4), 2), 1), 3)', '  2), 4), 3), 1)', 'C', NULL, '', '', '', '', '', ''),
