(716, 21, 11, ' Perhatikan kutipan berikut.Manusia pasti memiliki kelenjar keringat yang berjumlah sekitar dua juta. Kelenjar tersebut dapat menghasilkan 2.8 liter keringat setiap hari. Keringat ini dapat menimbulkan bau yang dapat mengganggu kenyamanan. Bau badan disebabkan oleh beberapa faktor. Faktor tersebut berasal dari diri sendiri maupun dari luar.Faktor yang berasal dari diri sendiri, yakni berat badan, keadaan emosional, penyakit fisik, dan kegiatan otot. Berat badan seseorang terkadang menentukan jumlah keringat yang keluar, orang yang memiliki berat badan lebih akan mengeluarkan banyak keringat. Orang yang baru emosi atau yang baru melakukan kegiatan otot (misalnya, olahraga) juga mengeluarkan banyak keringat. Teks di atas termasuk jenis teks&hellip;.', 1, '  Teks eksplanasi', '  Teks prosedur kompleks', ' Teks cerita ulang', ' Teks cerpen', '  Teks anekdot', 'E', NULL, '', '', '', '', '', ''),
(717, 21, 12, ' Perhatikan kutipan berikut.Gempa es disebabkan oleh gletser. Seorang peneliti mempelajari bagaimana gletser membuat gempa es di Antartika. Gempa es tersebut disebabkan oleh gravitasi dan gelombang pasang-surut.Gaya gravitasi menyebabkan aliran Es Whilans tertarik. Tarikan gaya gravitasi menimbulkan daratan es pecah dengan lebar sekitar 96.5 km dan panjang sekitar 482 km ke arah Laut Ross.Gelombang dan pasang mendorong lempeng Es Ross, menghantam gletser yang turun. Gletser terhenti. Saat gelombang surut, es tiba-tiba maju dengan gerakan yang setara dengan gempa berkekuatan 7 pada skala Richter.Teks di atas memiliki struktur&hellip;.', 1, ' Pernyataan umum, aspek yang dilaporkan', ' Tujuan, langkah-langkah', ' Orientasi, krisis, reaksi, koda', ' Pernyataan umum, urutan sebab-akibat', ' Pernyataan umum, argumentasi, reiterasi', 'D', NULL, '', '', '', '', '', ''),
