(727, 21, 22, '  Cermati ilustrasi berikut.Dalam acara pelepassan siswa SMK Bina Karya, Syafiq menyampaikan pidato sambutan mewakili siswa kelas X dan XI.Bagian isi pidato Syaifiq yang tepat adalah...', 1, '  Pertahankan prestasi kalian, agar orang tua kalian semakin bangga.', '  Pada kesempatan yang baik ini, saya ucapkan terimakasih. Semoga segala pengorbanan kalian mendapat imbalan dari Tuhan.', '  Berjuanglah terus sampai titik darah penghabisan.', '  Kami ucapkan selamat dan sukses untuk kakak. Semoga di jenjang yang lebih tinggi, Kakak lebih sukses.', '  Teman-teman semua, janganlah kita budayakan bolos karena bolos itu tindakan yang sangat merugikan diri sendiri.', 'D', NULL, '', '', '', '', '', ''),
(728, 21, 23, ' Perhatikanlah beberapa hal dalam ceramah berikut.1) Menguasai materi.2) Berpenampilan menarik.3) Berbicara singkat, padat, jelas.4) Menggunakan intonasi dan mimik yang tepat.5) Menggunakan gerak tubuh yang wajar.6) Kendalikan ketegangan.7) Menguunakan bahasa yang baik.8) Tidak terpaku pada teks.Persyaratan yang harus dipenuhi jika ceramah menggunakan teks/ nasskah adalah...', 1, '  1), 2), 4), 5), 7)', '  1), 3), 6), 7), 8)', '  2), 3), 5), 7), 8)', '  2), 4), 5), 6), 7)', '  2), 4), 5), 7), 8)', 'B', NULL, '', '', '', '', '', ''),
(729, 21, 24, ' Hal-hal penting yang tidak perlu disiapkan ketika hendak berceramah ialah...', 1, '  Tema yang hendak disampaikan dalam ceramah', '  Analisis pendengar dan suasana', '  Bersuara keras', '  Kerangka teks', '  Latihan semaksimal mungkin', 'C', NULL, '', '', '', '', '', ''),
(730, 21, 25, ' Penulisan huruf kapital yang benar ialah...', 1, '  Ibu pergi ke surabaya.', '  Adik berkata, &ldquo;Kemana nenek pergi?&rdquo;', '  Aku berlibur ke Pulau Dewata.', '  Dia baru saja mendapatkan gelar Sp.d', '  Jeromi baru lulus dari Sma Negeri jakarta.', 'C', NULL, '', '', '', '', '', ''),
(731, 21, 26, ' Kalimat berikut yang berpola S-P-O-K ialah...', 1, '  Adiknya seorang penyanyi dan pelukis.', '  Bibi pergi ke Surabaya.', '  Ayah mencuci mobil di belakang rumah.', '  Memakai baju baru.', '  Anita dan Sinta sedang berlibur.', 'C', NULL, '', '', '', '', '', ''),
(732, 21, 27, ' Pemakaian tanda baca yang benar terdapat pada kalimat...', 1, '  Karena sedih, adik menangis di kamarnya.', '  Adik dan kakak belum pulang, walaupun sudah malam.', '  Ibu membeli nasi, pisang, dan jeruk.', '  Murid, dan guru sedang mengikuti upacara bendera.', '  Ban mobil kami pecah, karena itu kami tidak bisa datang.', 'C', NULL, '', '', '', '', '', ''),
(733, 21, 28, ' Buku yang dibuat berdasarkan fakta, realitas atau hal-hal yang benar-benar terjadi dalam kehidupan sehari-hari disebut dengan buku...', 1, '  Fiksi', '  Nonfiksi', '  Pengayaan', '  Wajib', '  Pelajaran', 'B', NULL, '', '', '', '', '', ''),
(734, 21, 29, 'Bacalah teks berikut dengan saksama.Perilaku sehat merupakan pilar yang paling utama. Hal ini karena komponen tersebut ternyata sangat berpengaruh pada kedua pilar lainnya. Seperti seseorang dengan perilaku sehat, tentu akan menjaga lingkungannya tetap sehat juga. Selain itu, dengan perilaku sehat, seseorang akan memanfaatkan fasilitas pelayanan kesehatan yang ada untuk memelihara kesehatannya.Ide pokok paragraf tersebut adalah...', 1, ' Memanfaatkan fasilitas kesehatan yang ada', ' Menjaga lingkungannya agar tetap sehat', ' Perilaku sehat akan berpengaruh pada pilar-pilar lainnya', ' berperilaku sehat akan menjaga kebersihan', '  Perilaku sehat merupakan pilar utama', 'E', NULL, '', '', '', '', '', ''),
(735, 21, 30, ' Perhatikan kutipan berikut.Dari uji praklinik maupun klinik dapat disimpulkan bahwa pare sangat berpeluang dijadikan sumber fitofarmaka antidiabetes. Penelitian pare sebagai antidiabetes diawali dengan pembuktian secara alamiah mengenai kemampuannya menurunkan kadar glukosa darah pada hewan uji dalam kondisi normal maupun diabetes. Dilaporkan, ekstrak air buah pare menunjukkan efek hipoglikemik (menurunkan kadar glukosa darah) pada orang normal maupun diabetes yang diinduksi streptozotosin.Gagasan yang terkandung dalam penggalan wacana tersebut ialah ... .', 1, ' Hasil uji praklinik tentang pare.', ' Pare sangat berpeluang dijadikan sumber fitofarmaka antidiabetes.', ' Penelitian pare sebagai antidiabetes diawali dengan pembuktian.', ' Pare menurunkan kadar glukosa darah pada hewan uji.', ' Ekstrak air buah pare menurunkan kadar glukosa/darah pada orang normal.', 'A', NULL, '', '', '', '', '', ''),
(736, 22, 1, ' Hak asasi manusia adalah&hellip;. ', 1, ' Hak asasi pribadi yang tak dapat diganggu gugat ', ' Hak yang bisa diambil dari orang lain ', ' Hak yang melekat pada diri setiap orang ', ' Hak yang diberikan oleh pemerintah ', ' Hak yang muncul karena adanya status kewarganegaraan ', 'C', NULL, '', '', '', '', '', ''),
(737, 22, 2, '  Kewajiban asasi adalah&hellip;. ', 1, ' Kewajiban dasar setiap orang ', ' Kewajiban manusia terhadap Tuhan Yang Maha Esa ', ' Kewajiban warga negara terhadap negaranya ', ' Kewajiban yang muncul karena status sebagai anggota dari suatu negara ', ' Kewajiban yang harus dilaksanakan oleh setiap orang pada negara yang melindunginya', 'A', NULL, '', '', '', '', '', ''),
(738, 22, 3, ' Perhatikan ciri-ciri hak asasi manusia di bawah ini ! (1). Hakiki (2). Tunggal (3). Tidak dapat dibagi (4). Ketergantungan (5). Universal Dari data diatas, yang merupakan ciri HAM di tunjukkan oleh nomor ... ', 1, ' (1), (2), dan (3) ', ' (1), (2), dan (4) ', ' (1), (3), dan (5) ', ' (3), (4), dan (5) ', ' (4), (5), dan (6) ', 'C', NULL, '', '', '', '', '', ''),
(739, 22, 4, ' Undang-undang Republik Indonesia yang mengatur tentang HAM adalah&hellip;. ', 1, ' Undang-undang no. 3 tahun 1997 ', ' Undang-undang no. 39 tahun 1999 ', ' Undang-undang no. 26 tahun 2000 ', ' Undang-undang no. 23 tahun 2002 ', ' Undang-undang no. 11 tahun 2012', 'B', NULL, '', '', '', '', '', ''),
(740, 22, 5, ' Jika anda melihat anak-anak jalanan dan melakukan pekerjaan-pekerjaan yang seharusnya tidak mereka lakukan, seperti meminta-minta, menjadi pemulung, mengamen dan sebagainya pada jam sekolah , maka pada dasarnya mereka mengalami masalah yakni tidak terpenuhinya hak asasi dalam bidang&hellip; ', 1, ' ekonomi ', ' politik ', ' sosial budaya ', ' hukum ', ' pribadi', 'C', NULL, '', '', '', '', '', ''),
(741, 22, 6, ' Salah satu bentuk tindakan pencegahan yang dapat dilakukan untuk mengatasi berbagai kasus pelanggaran HAM adalah meningkatkan penyebarluasan prinsip-prinsip HAM kepada masyarakat melalui pendidikan formal , hal ini dapat dilakukan dengan cara&hellip;. ', 1, ' Melalui pembentukan peradilan HAM ', ' Pembentukan masyarakat peduli HAM ', ' Melalui kurikulum sekolah yang memuat HAM ', ' Melalui ceramah-ceramah keagamaan di masyarakat ', ' Melalui kampanye partai-partai politik', 'C', NULL, '', '', '', '', '', ''),
(742, 22, 7, ' Yang bukan merupakan wewenang Komnas HAM adalah.&hellip; ', 1, ' Melakukan perdamaian pada kedua belah pihak yang bermasalah ', ' Menyelesaikan masalah secara konsultasi maupun negosiasi ', ' Menyampaikan rekomendasi atas kasus pelanggaran HAM kepada pemerintah dan DPR ', ' Memberi saran kepada pihak yang bermasalah untuk menyelesaikan sengketa di pengadilan ', ' Melakukan peradilan terhadap pelanggaran HAM berat pada kasus HAM yang terjadi di seluruh Indonesia', 'E', NULL, '', '', '', '', '', ''),
(743, 22, 8, ' Komnas HAM di Indonesia sudah ada dan dibentuk berdasarkan.&hellip; ', 1, ' Keppres No. 50 tahun 1993 ', ' Keppres No. 83 tahun 1998 ', '  Keppres No.31 tahun 2001 ', ' Keppres No. 53 tahun 2001 ', ' Keppres No. 40 tahun 2004', 'A', NULL, '', '', '', '', '', ''),
(744, 22, 9, ' Perhatikan data berikut :1) Sikap egois2) Penyalahgunaan kekuasaan 3) Rendahnya kesadaran HAM 4) Sikap tidak toleran 5) Penyalahgunaan teknologiDari data diatas yang merupakan faktor internal yang mendorong terjadinya pelanggaran hak asasi manusia adalah&hellip;  ', 1, ' 1),2),3) ', ' 1),2),4) ', ' 1),3),4) ', ' 2),3),5) ', ' 3),4),5)', 'C', NULL, '', '', '', '', '', ''),
(745, 22, 10, ' Undang-undang Republik Indonesia yang mengatur tentang pengadilan Hak Asasi Manusia adalah&hellip;. ', 1, ' Kepres no 50 tahun 1993 ', ' Undang-undang no 39 tahun 1999 ', ' Undang-undang no 40 tahun 1999 ', ' Undang-undang no 26 tahun 2000 ', ' Undang-undang no 23 tahun 2002 ', 'D', NULL, '', '', '', '', '', ''),
(746, 22, 11, ' Hak dasar yang dimiliki manusia sebagai pemberian dari Tuhan Yang Maha Esa, disebut&hellip; ', 1, ' Hak Kodrat ', ' Hak warga negara ', ' Hak asasi manusia ', ' Hak penduduk ', ' Hak dan kewajiban asasi', 'C', NULL, '', '', '', '', '', ''),
(747, 22, 12, ' Setiap perbuatan seseorang atau sekelompok orang termasuk aparat negara, baik disengaja maupun tidak disengaja atau kelalaian yang secara hukum mengurangi, menghalangi, membatasi dan atau mencabut hak asasi manusia seseorang atau kelompok orang yang dijamin oleh undang-undang dan tidak mendapatkan atau dikhawatirkan tidak akan memperoleh penyelesaian hukum yang adil dan benar berdasarkan mekanisme hukum yang berlaku. merupakan pengertian dari&hellip; ', 1, ' Pelanggaran hak asasi manusia ', ' Kelalaian hak asasi manusia ', ' Pelanggaran hukum ', ' Perbuatan hukum ', ' Peristiwa hukum', 'A', NULL, '', '', '', '', '', ''),
(748, 22, 13, ' Hak asasi manusia dalam UUD 1945, diatur dalam pasal&hellip; ', 1, ' 24 ayat 1 ', ' 25A ', ' 26 ayat 2 ', ' 27 ayat 3 ', ' 28 A-J', 'E', NULL, '', '', '', '', '', ''),
(749, 22, 14, ' Perhatikan data berikut : 1) Membunuh anggota kelompok 2) Mengakibatkan penderitaan fisik dan mental berat pada anggota kelompok 3) Perampasan kemerdekaan atau perampasan kebebasan fisik 4) Memisahkan anak secara paksa ke dalam kelompok tertentu 5) Perkosaan, perbudakan seksual, pelacuran secara paksa Dari pernyataan diatas, yang termasuk dalam kejahatan genosida sesuai dengan UU nomor 26 tahun 2000 adalah&hellip;.', 1, ' 1), 2), 3) ', ' 1), 2), 4) ', ' 2), 3), 4) ', ' 2), 3), 5) ', ' 3), 4), 5)', 'B', NULL, '', '', '', '', '', ''),
(750, 22, 15, ' Munir adalah seorang tokoh pejuang yang berusaha menegakkan HAM di Indonesia, bentuk penegakkan HAM yang dilakukan oleh Munir adalah untuk&hellip;  ', 1, ' Membela buruh yang tertindas hak-haknya ', ' Membela mahakalian yang dilanggar hak asasinya pada aksi demonstrasi ', ' Memperjuangkan aktivis yang dinyatakan hilang pada tahun 1999 ', ' Membela masyarakat pada kasus Tanjung Periok ', ' Membela mahakalian pada kasus tragedi semanggi 1 ', 'C', NULL, '', '', '', '', '', ''),
(751, 22, 16, ' Perhatikan data berikut : 1) Sikap egois 2) Penyalahgunaan kekuasaan 3) Rendahnya kesadaran HAM 4) Sikap tidak toleran 5) Penyalahgunaan teknologi Dari data diatas yang merupakan faktor internal yang mendorong terjadinya pelanggaran Hak asasi manusia adalah&hellip; ', 1, ' 1), 2), 3) ', ' 1), 2), 4) ', ' 1), 3), 4) ', ' 2), 3), 5) ', ' 3), 4), 5)', 'C', NULL, '', '', '', '', '', ''),
(752, 22, 17, ' Penyalahgunaan teknologi termasuk dalam faktor eksternal yang menjadi penyebab terjadinya pelanggaran HAM, berikut ini yang merupakan contoh penyalahgunaan teknologi yang mengakibatkan pelanggaran HAM adalah&hellip; ', 1, ' Kesulitan ekonomi yang menyebabkan seseorang melakukan tindakan kejahatan bahkan sampai membunuh ', ' Seseorang yang menggunakan kekuasaannya untuk melakukan tindakan korupsi ', ' Seseorang yang dengan sengaja menggunakan jejaring sosial untuk melakukan penipuan dan kemudian menculik korban ', ' Aparat penegak hukum yang bertindak sewenang-wenang terhadap masyarakat ', ' Seorang pengusaha yang tidak memperdulikan hak-hak buruhnya ', 'C', NULL, '', '', '', '', '', ''),
(753, 22, 18, ' Tragedi semanggi 1 merupakan bentuk pelanggaran HAM yang terjadi pada tanggal&hellip; ', 1, ' 12 September 1984 ', ' 12 Mei 1998 ', ' 13 September 1998 ', ' 13 November 1998 ', ' 24 November 1999 ', 'D', NULL, '', '', '', '', '', ''),
(754, 22, 19, ' Kasus kerusuhan Tanjung Priok tahun 1984 merupakan bentuk pelanggaran HAM, yang terjadi akibat bentrok antara&hellip;. ', 1, ' Aparat dengan masyarakat ', ' Masyarakat dengan masyarakat ', ' Aparat dengan aparat ', ' Mahakalian dengan masyarakat ', ' Mahakalian dengan aparat ', 'A', NULL, '', '', '', '', '', ''),
(755, 22, 20, ' Dalam berbagai kasus pelanggaran HAM yang terjadi di Indonesia baik yang dilakukan oleh pemerintah maupun masyarakat, pelanggaran HAM tersebut mencerminkan&hellip; ', 1, ' Masyarakat yang demokratis namun belum dewasa ', ' Masyarakat yang harmonis namun pemerintahan yang tidak stabil ', ' Masyarakat yang liberal dan bersikap individualis ', ' Masyarakat yang mementingkan kepentingan ekonomi semata dan berjiwa sosial ', ' Kelalaian masyarakat atas pelaksanaan kewajiban asasi manusia', 'E', NULL, '', '', '', '', '', ''),
(756, 22, 21, ' Berikut yang bukan merupakan langkah-langkah yang dilakukan oleh pemerintah untuk menegakkan HAM di Indonesia.adalah&hellip; ', 1, ' Pembentukan komisi nasional Hak Asasi Manusia ', ' Pembentukan undang-undang HAM ', ' Pembentukan peradilan HAM ', ' Membentuk mahkamah HAM ', ' Ratifikasi Instrumen HAM Internasional', 'D', NULL, '', '', '', '', '', ''),
(757, 22, 22, ' Undang-Undang Republik Indonesia nomor 23 Tahun 2002 merupakan salah satu instrumentHAM yang mengatur tentang&hellip;. ', 1, ' Hak asasi manusia ', ' Pengadilan HAM ', ' Perlindungan anak ', ' Sistem peradilan anak ', ' Perlindungan saksi dan korban', 'C', NULL, '', '', '', '', '', ''),
(758, 22, 23, ' Berikut yang tidak termasuk tindakan yang dapat dilakukan untuk mengatasi terjadinya pelanggaran HAM adalah&hellip;. ', 1, ' Supremasi hukum dan demokrasi harus ditegakkan ', ' Meningkatkan kualitas pelayanan publik ', ' Meningkatkan pengawasan dari masyarakat terhadap upaya penegakan HAM ', ' Meningkatkan penyebarluasan prinsip-prinsip HAM kepada masyarakat ', ' Memberikan hukuman mati kepada semua pelaku pelanggaran HAM ', 'E', NULL, '', '', '', '', '', ''),
(759, 22, 24, ' Yang merupakan contoh penegakkan HAM dilingkungan sekolah adalah&hellip; ', 1, ' Menghormati dan menyayangi adik kakak ', ' Tidak memaksakan kehendak kepada teman dan guru ', ' Tidak menghardik pengemis atau kaum dhu&rsquo;afa ', ' Memahami dan mentaati setiap isntrumen HAM yang berlaku ', ' Mentaati semua hukum yang berlaku di Indonesia ', 'B', NULL, '', '', '', '', '', ''),
(760, 22, 25, ' Kebebasan beragama merupakan kebebasan seseorang sebagai &hellip;. ', 1, ' Hak asasi pribadi ', ' Hak politik ', ' Hak sosial budaya ', ' Hak ekonomi ', ' Hak hukum ', 'A', NULL, '', '', '', '', '', ''),
(761, 22, 26, ' Negara memberikan jaminan untuk memeluk agama dan beribadah menurut agama dan kepercayaannya masing-masing, jaminan ini diberikan oleh pemerintah Indonesia sesuai undang undang kepada&hellip; ', 1, ' Warga negara ', ' Penduduk ', ' Warga negara dan penduuk ', ' Semua orang ', ' Penduduk dan bukan penduduk', 'B', NULL, '', '', '', '', '', ''),
(762, 22, 27, ' Salah satu bentuk kerjasama yang dilakukan antar umat beragama dalam lingkungan masyarakat adalah..', 1, ' Bersama-sama merayakan hari besar agama tertentu ', ' Bersama-sama menjalankan ibadah dalam satu tempat ', ' Melakukan gotong royong untuk membersihkan lingkungan ', ' Membiarkan orang lain beribadah sesuai keyakinannya ', ' Memaksa agama lain untuk ikut perayaan hari besar agamanya ', 'C', NULL, '', '', '', '', '', ''),
(763, 22, 28, ' Hak asasi warga negara Indonesia secara penuh tercantum dalam&hellip;', 1, ' Undang- Undang ', ' UUD NRI Tahun 1945 ', ' TAP MPR ', ' Perpres ', ' Perda', 'B', NULL, '', '', '', '', '', ''),
(764, 22, 29, ' Dalam diri manusia pada hakekatnya melekat tiga macam hak, yaitu.... ', 1, ' Hak berpolitik, hak hidup, hak berekspresi ', ' Hak asasi ekonomi, sosial budaya, politik ', ' Hak hidup, hak kebebasan dan hak milik ', ' Hak beragama, hak persamaan hukum, hak hidup ', ' Hak berpendapat, hak berusaha, hak berpolitik ', 'C', NULL, '', '', '', '', '', ''),
(765, 22, 30, ' Pelanggaran HAM dapat terjadi di mana saja dan kapan saja, tanpa mengenal status, jenis kelamin dan usia. Oleh karena itu, pemerintah dapat melakukan upaya pemajuan, penghormatan dan penegakan HAM berupa....', 1, ' membentuk peraturan perundang-undangan tentang pencucian uang ', ' ', ' melakukan perlindungan kepada para saksi dan korban jika diminta ', ' membentuk Komisi untuk orang hilang dan korban tindak kekerasan (Kontras) ', ' pembentukan pengadilan HAM yang akan menangani kasus pelanggaran HAM ', 'D', NULL, '', '', '', '', '', ''),
