(957, 29, 17, '  Farhan : So, how long has it been since the first publishing of your first novel? Yola : It&rsquo;s been 3 weeks since then. Farhan: So, how many copies have been sold this far? Yola :  Thank God. Many people seem to like it very much. Since the first publishing 3 weeks ago, there have been over 500 copies sold. Farhan : Splendid! I&rsquo;d like to congratulate you on your success at your first time publishing your novels. Yola : Thanks Farhan : Keep the good work, Yola. I know you could be a great author someday.   What does Yola achieve? ', 1, ' Publishing her novel ', ' Writing the first poem ', ' Winning a trophy ', ' Becoming the best author ', ' Selling her books. ', 'A', NULL, '', '', '', '', '', ''),
